import React from 'react';
import './App.css';

class App extends React.Component {
  state = { open: false };

  onToggle = (event) => {
    this.setState({ open: true });
  }

  render() {
    return (
      <button onClick={(event) => this.onToggle(event)}>
      hello, Friend!
      </button>
    );
  }
}

export default App;
